import './sign.css'

function SingUp() {
    return (
        <div className="sign">
            <form className="sign__form">
                <h2 className="sign__form-title">Регистрация</h2>
            </form>
            <input className="sign__form-input"></input>
        </div>
    )
}

export default SingUp;
